class Vector{constructor(a,b){this.x=a,this.y=b}normalize(){const a=this.calcAng();return this.x=Math.cos(a),this.y=Math.sin(a),this}copy(){return new Vector(this.x,this.y)}calcAng(){return Math.atan2(this.y,this.x)}add(a){return this.x+=a.x,this.y+=a.y,this}static add(a,b){const c=a.x+b.x,d=a.y+b.y;return new Vector(c,d)}sub(a){return this.x-=a.x,this.y-=a.y,this}static sub(a,b){const c=a.x-b.x,d=a.y-b.y;return new Vector(c,d)}dot(a){return this.x*a.x+this.y*a.y}static dot(a,b){return a.x*b.x+a.y*b.y}cross(a){return this.x*a.y-this.y*a.x}static cross(a,b){return a.x*b.y-a.y*b.x}multiply(a){return this.x*=a,this.y*=a,this}getMag(){return Math.sqrt(this.x*this.x+this.y*this.y)}getMagSq(){return this.x*this.x+this.y*this.y}setMag(a){return this.normalize(),this.multiply(a),this}limit(a){return this.getMagSq()>a*a&&this.setMag(a),this}setAng(a){return this.x=Math.cos(a),this.y=Math.sin(a),this}set(a,b){return this.x=a,this.y=b,this}}